import React from "react";
import { SearchContainer } from "./Search.style";

const Search = () => {
  return (
    <SearchContainer>
      <input class="searchInput" type="text" name="" placeholder="Search" />
      <searchButtonContainer>
        <svg
          width="79"
          height="78"
          viewBox="0 0 79 78"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <circle cx="54" cy="25" r="23" stroke="black" stroke-width="4" />
          <line
            x1="37.0904"
            y1="41.1518"
            x2="2.09036"
            y2="75.1518"
            stroke="black"
            stroke-width="6"
          />
        </svg>
      </searchButtonContainer>
    </SearchContainer>
  );
};
export default Search;
